package com.progym.model;

public class AddMemberObject {
	
	
	public AddMemberObject() {
		super();
		// TODO Auto-generated constructor stub
	}
	private String name;
	private String mobile;
	private String gender;
	private String dob;
	private String packageCategory;
	private String packageDuration;
	private String cpackage;
	private String remarks;
	
	
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getMobile() {
		return mobile;
	}
	public void setMobile(String mobile) {
		this.mobile = mobile;
	}
	public String getGender() {
		return gender;
	}
	public void setGender(String gender) {
		this.gender = gender;
	}
	public String getDob() {
		return dob;
	}
	public void setDob(String dob) {
		this.dob = dob;
	}
	public String getPackageCategory() {
		return packageCategory;
	}
	public void setPackageCategory(String packageCategory) {
		this.packageCategory = packageCategory;
	}
	public String getPackageDuration() {
		return packageDuration;
	}
	public void setPackageDuration(String packageDuration) {
		this.packageDuration = packageDuration;
	}
	public String getCpackage() {
		return cpackage;
	}
	public void setCpackage(String cpackage) {
		this.cpackage = cpackage;
	}
	
	public String getRemarks() {
		return remarks;
	}
	public void setRemarks(String remarks) {
		this.remarks = remarks;
	}
	
	
	

}
